import React from "react";
import Image from "../../../assests/logo.png";
import styles from "./logo.module.css"
const Logo = () => {
  return (
    <div className={styles.mainDiv}>
     <div>

      <img src={Image} alt="" />
     </div>
    </div>
  );
};

export default Logo;
